import axios from 'axios';
export default class App extends React.Component{
  constructor(){
    super()
    this.state={
      First_Name:"",
      Last_Name:"",
      DOB:"",
      Country:"",
      Nationality:"",
      Email:"",
      Alternate_Email:"",
      Phone_no:"",
      Password:""
    }
  }
  dataChange(ev){
    this.setState({
      [ev.target.First_Name]:ev.target.value
    })
  }
  postData(ev){
    ev.preventDefault()
    const First_Name=this.state

    this.state({
      loading:true
    })
    const data={
      First_Name,
      Last_Name
    }
    axios.post('',data)
    .then(response=>{})
  }
  loadorShowing(){
    if(this.state.loading){
      return <p>Loading..</p>
    }
    else{
      return <p>{this.state.meeting}</p>
    }
  }
  render(){
    return(
      <div>
        <form>        
        <h1>Employee</h1>
        <input type="text" value="{this.state.First_Name}" name="First_Name" onChange={this.dataChange.bind(this)}/><br /> <br />
